import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the first product card to open modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');

    // Wait for product detail modal to appear
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Extract product details from modal
    const extractedData = await page.evaluate(() => {
      const title = document.querySelector('.product-detail-title')?.textContent || '';
      const price = document.querySelector('.product-detail-price')?.textContent || '';
      const rating = document.querySelector('.product-detail-rating .stars')?.textContent || '';

      return {
        productTitle: title.trim(),
        productPrice: price.trim(),
        productRating: rating.trim()
      };
    });

    return {
      success: true,
      action: "Opened product detail modal by clicking on product card",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
